import React from 'react';
import './TemplateSelector.css';

const templates = [
  { id: 'waveform', name: 'Waveform', description: 'Classic waveform visualization' },
  { id: 'bars', name: 'Frequency Bars', description: 'Vertical frequency bars' },
  { id: 'circles', name: 'Circular', description: 'Circular frequency visualization' },
  { id: 'kaleidoscope', name: 'Kaleidoscope', description: 'Symmetrical psychedelic patterns' },
  { id: 'spiral', name: 'Spiral', description: 'Dynamic spiral visualization' },
  { id: 'particles', name: 'Particles', description: 'Interactive particle system' }
];

const TemplateSelector = ({ selectedTemplate, onTemplateChange }) => {
  return (
    <div className="template-selector">
      <h3>Select Template</h3>
      <div className="template-grid">
        {templates.map((template) => (
          <div
            key={template.id}
            className={`template-card ${selectedTemplate === template.id ? 'selected' : ''}`}
            onClick={() => onTemplateChange(template.id)}
          >
            <div className="template-preview">
              <div className={`preview-${template.id}`} />
            </div>
            <h4>{template.name}</h4>
            <p>{template.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default TemplateSelector;
